import React from "react";
import { useState } from "react";
import { useEffect } from "react";
import { Row, Col } from "reactstrap";
import { toast } from "react-toastify";
import InfiniteScroll from "react-infinite-scroll-component";
import Base from "../../components/Base";
import Post from "../../components/Post";
import { loadPostByCat } from "../../services/post-service";
import { Link, NavLink as ReactLink, useNavigate } from "react-router-dom";
const Technology = () => {
  //defining postContent
  const [postContent, setPostContent] = useState({
    content: [],
    totalPages: "",
    totalElements: "",
    pageSize: "",
    lastPage: false,
    pageNumber: "",
  });

  // to call a function for a first Time
  const [currentPage, setCurrentPage] = useState(0);

  useEffect(() => {
    console.log("loading posts");
    console.log(currentPage);
    changePage(currentPage);
  }, [currentPage]);

  const changePage = (event, pageNumber = 0, pageSize = 5) => {
    console.log("******************************");
    console.log(event);
    let x = 1;
    switch (event) {
      case "Orange":
        x = 1;
        break;
      case "Radish":
        x = 2;
        break;
      case "Cherry":
        x = 2;
        break;
      default:
        x = 1;
    }

    if (pageNumber > postContent.pageNumber && postContent.lastPage) {
      return;
    }
    if (pageNumber < postContent.pageNumber && postContent.pageNumber == 0) {
      return;
    }
    console.log(x);
    loadPostByCat(2, pageNumber, pageSize)
      .then((data) => {
        console.log(data, "Before");
        setPostContent({
          content: [...postContent.content, ...data.content],
          totalPages: data.totalPages,
          totalElements: data.totalElements,
          pageSize: data.pageSize,
          lastPage: data.lastPage,
          pageNumber: data.pageNumber,
        });

        console.log(setPostContent, "After");
      })
      .catch((error) => {
        toast.error("Error in loading posts");
      });
  };

  const changePageInfinite = () => {
    console.log("page chagned");
    setCurrentPage(currentPage + 1);
  };

  const getInitialState = () => {
    const value = "Orange";
    return value;
  };

  const [value, setValue] = useState(getInitialState);

  const handleChange = (e) => {
    console.log("XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX");
    console.log(e.target.value);
    navigate(e);
  };

  return (
    <Base>
      <div className="container-fluid pt-5 pe-1 ps-1">
        <Row>
          <Col
            md={{
              size: 10,
              offset: 1,
            }}
          >
            <div className="d-flex categorySelect">
              <h1>
                {value} ( {postContent?.totalElements} ) Tech
              </h1>
              {/* <select
                value={value}
                class="rounded col-sm-1 categoryDrop "
                aria-label="Default select example"
                onChange={handleChange}
              >
                <option value="Orange">Orange</option>
                <option value="/science">Science</option>
                <option value="Cherry">Cherry</option>
              </select> */}

<div id="mydiv" class="dropdown transparentbar" style="z-index:4">
  <button class="btn btn-default dropdown-toggle" type="button" id="mybyn" data-toggle="dropdown" aria-haspopup="true" aria-expanded="true">
    Drop mat
    <span class="caret"></span></button>
  <ul class="dropdown-menu">
    <li><a href="#">Action</a></li>
    <li><a href="#">Another action</a></li>
    <li><a href="#">Something else here</a></li>
    <li role="separator" class="divider"></li>
    <li><a href="#">Separated link</a></li>
  </ul> 
</div>
            </div>
            

            <InfiniteScroll
              dataLength={postContent.content.length}
              next={changePageInfinite}
              hasMore={!postContent.lastPage}
              loader={<h4>Loading...</h4>}
              endMessage={
                <p style={{ textAlign: "center" }}>
                  <b>Yay! You have seen it all</b>
                </p>
              }
            >
              {postContent.content.map((post, index) => (
                <Post post={post} key={index} />
              ))}
            </InfiniteScroll>
          </Col>
        </Row>
      </div>
    </Base>
  );
};

export default Technology;
